import React from "react";
import { BrowserRouter, RouterProvider as Router, Route, Routes, createBrowserRouter, RouterProvider } from 'react-router-dom';

import Home from './pages/Home';
import Config from './pages/config';
import CriarEvento from './pages/CriarEvento';
import DescubraEvento from './pages/DescubraEvento';
import Competencias from './pages/Competencias';
import Nivelamento from './pages/Nivelamento';

const router = createBrowserRouter([
    {
        path: "/",
        element: <App />,
        children: [
            { path: "/Competencias", element: <Competencias />},
            { path: "/Nivelamento", element: <Nivelamento />},
        ]
    }
])



export default () => {

    return (
                <Routes>
                    <RouterProvider router={router} />
                    <Route exact path="/" element={<Home />} />
                    <Route exact path="/config" element={<Config />} />
                    <Route exact path="/CriarEvento" element={<CriarEvento />} />
                    <Route exact path="/DescubraEvento" element={<DescubraEvento />} />
                    <Route excat path="/Competencias" element={<Competencias />} />
                    <Route excat path="/Nivelamento" element={<Nivelamento />} />
                </Routes>
        
    );
}
